class Solution:
    def maxOperations(self, s: str) -> int:
        n = len(s)
        moves = 0
        prior_moves = 0
        back_string = s[::-1]
        for i, x in enumerate(back_string):
            if x == '0':
                continue
            if i > 0 and back_string[i - 1] == '0':
                prior_moves = prior_moves + 1
            moves += prior_moves
        return moves
